import "../styles/board.css";

export default function Board() {
  let board = [];
  for (let i = 0; i < 9; i++) {
    let box = [];
    for (let j = 0; j < 9; j++) {
      box.push(0);
    }
    board.push(box);
  }
  console.log(board);
  return (
    <div className="board">
      {board.map((element, index) => {
        return <div className="grid-box" id={index.toString()}></div>;
      })}
    </div>
  );
}
